When Marte Allon, the mother of Colossal Boy as well as the President of Earth, steps down from her office, super-computers find the most eligible nominees for the position. Those nominees are soon attacked by Khund assassins but the Legion are able to prevent any murders. While Jacques Foccart, the Invisible Kid, fights off one of those Khund assassins, he finds that his powers are growing beyond his control and he teleports them into space, where the Khund cannot survive without assistance, and dies.

